// HomePage.js

import React from 'react';
import Header from './Header';
import HomeMainSection from './HomeMainSection';
import Footer from './Footer';

const HomePage = () => {
  return (
    <div>
      <Header />
      <HomeMainSection />
      <Footer />
    </div>
  );
};

export default HomePage;
